import { Grid, GridItem } from "@chakra-ui/react";
import Form from "./Form";
import ListOfBooks from "./ListOfBooks";

const Home: React.FC =() => {


    return(
        <Grid gap={6}>
            <GridItem colSpan={2}>
                <Form />
            </GridItem>

            <GridItem colSpan={2}>
            <ListOfBooks />
            </GridItem>
        </Grid>
    )
}


export default Home;
